<div id="a-plot-of-where-mosquitos-were-measured" class="section level2">
<h2>A Plot of Where Mosquitos Were Measured</h2>
<p>Heres where we have measurement points for some date in the training data:</p>
<pre class="r"><code># Shows where there are measurement points
ggmap(mapdata) + 
  geom_point(aes(x=Longitude, y=Latitude), data=wnv) +
